import {createTheme} from '@mui/material'

const MuiDropZoneAreaTheme ={
  MuiDropzoneArea:{
    text:{
      color: '#000000'
    }
  }

}

export  const theme = createTheme({
    palette:{
      primary:{
        main:'#0b5eec',
        light: '#b9deff',
        dark: '#203864',
      },
      secondary:{
        main:'#ec9a0b',
        light: '#fcf7e1',
        dark: '#ea6c03',
      },
      text:{
        primary:'#000000'
      }
    },
    overrides: MuiDropZoneAreaTheme
  });
